            <h2 className="text-center ">Image annotate prototype</h2>
              <p className="description">Draw objects conturs on top of the image</p>
            <div className="container col-md-1">
                       
              
              {/* <div className="Task-container col-8">
              <Canvas />        
              </div> */}
              <div className="">             
                
                    <RegionsList />          
                </div>                   
              
            </div>
            
      </div>
           
  </React.Fragment>
);
};

export default Task
